import * as tf from "@tensorflow/tfjs";
import "babel-polyfill";
import { loadFrozenModel } from "@tensorflow/tfjs-converter";
import { model } from "@tensorflow/tfjs";
import { async } from "q";

const loadImage = src => new Promise((resolve, reject) => {});

let pretrainedModel = file => {
  return loadingModel()
    .then(model => {
      const layer = model.getLayer("conv_pw_13_relu");
      return tf.model({
        inputs: [model.inputs[0]],
        outputs: layer.output
      });
    })
    .catch(err => console.log(err))
    .then(model => {
      return loadImage(file).then(loadedImage => {
        const image = tf.reshape(tf.browser.fromPixels(loadedImage), [
          1,
          224,
          224,
          3
        ]);
        const pretrainedModelPrediction = pretrainedModel.predict(image);
        const modelPrediction = model.predict(pretrainedModelPrediction);
        const prediction = modelPrediction
          .as1D()
          .argMax()
          .dataSync()[0];
        console.log(prediction);
      });
    })
    .catch(err => console.log(err));
};

const readURL = input => {
  return new Promise((resolve, reject) => {
    if (input.files && input.files[0]) {
      var reader = new FileReader();

      reader.onload = e => {
        document
          .querySelector("#display-img")
          .setAttribute("src", e.target.result);

        const image = new Image();
        image.src = e.target.result;
        image.crossOrigin = "Anonymous";
        image.onload = () => resolve(image);
        image.onerror = err => reject(err);
        resolve(reader);
      };
      reader.readAsDataURL(input.files[0]);
    }
  });
};

